import React from 'react';
import { NavLink } from 'react-router-dom';
import img from "./images/homepage.png";
const Home = () => {
    return (
        <>
            <section id="header">
                <div className="container-fluid">
                    <div className='row'>
                        <div className='col-10 mx-auto'>
                            <div className='row'>
                                <div className="col-md-6 pt-5 pt-lg-0 order-2 order-lg-1 d-flex flex-flow-col">
                                    <h1>Kick Start Your Coding Career with <strong> weCode.</strong></h1>
                                    <h2 className="my-3">
                                        We are a Team of Self-Taught Developers <br />
                                        making cool projects and learning new technologies.
                                    </h2>
                                    <div className="mt-3">
                                        <NavLink exact to="/services" className="btn-get-started">Get Started</NavLink>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </section>
        </>
    );
}
export default Home;
